import React from 'react';

import Hero from '../components/Hero';

function HomePage(props) {

    return (
        <div>
            <Hero />
            <h2>{props.title}</h2>
            <br />
            <h4>{props.subTitle}</h4>
            <p>{props.selfDescription}</p>
        </div>
    );

}

export default HomePage;
